import React from 'react';
import {NavLink} from 'react-router-dom';
const Menu =()=>{
    return(<><div className = "menu_bar">
            <NavLink exact to ='/login' activeClassName ="active_class">Login</NavLink>
            <NavLink exact to ='/chat' activeClassName ="active_class">Chat</NavLink>
            <NavLink exact to ='/listcontact' activeClassName ="active_class">Contact List </NavLink>
            <NavLink exact to ='/addcontact' activeClassName ="active_class">Add Contact</NavLink>

            </div> 
    </>)
}
export default Menu;
